import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container } from "react-bootstrap";
import "../css/header.css";

const Header = () => {
  return (
    <>
      <Container>
        <h1>hello world</h1>
      </Container>
    </>
  );
};

export default Header;
